export default function RobotInGame({x, y}) {
    const style = {
        width: "10px",
        height: "10px",
        position: "absolute",
        top: "100px",
        left: "100px",
        backgroundColor: "red"
    }
    return (<div id="RobotInGame">{style}</div>);
}
